INSERT INTO recommendedgamenews (id, name, description) VALUES (
    (1, 'League of Legends', 'is a team-based strategy game where two teams of five powerful champions face off to destroy the other\'s base. Choose from over 140 champions to make epic plays, secure kills, and take down towers as you battle your way to victory.'),
    (2, 'World of Warcraft', 's a Massively Multiplayer Online Roleplaying Game (MMORPG). It has a high fantasy theme borrowing from the traditions of C.S. Lewis and J.R.R. Tolkien.'),
    (3, 'Minecraft', 'is a video game in which players create and break apart various kinds of blocks in three-dimensional worlds. The game\'s two main modes are Survival and Creative. In Survival, players must find their own building supplies and food. They also interact with blocklike mobs, or moving creatures.'),
    (4, 'Tom Clancy\'s Rainbow Six: Siege', 'is a first-person shooter game, in which players utilize many different operators from the Rainbow team. ... An in-game shop allows players to purchase operators or cosmetics using the in-game currency, "Renown", which is earned at the end of matches from actions performed in-game.'),
    (5, 'Among Us', 'is a computer game developed by the company InnerSloth and released in 2018, described as an "online multiplayer social deduction game" wherein up to ten players run around inside a virtual spaceship completing classic spaceship maintenance tasks while trying to figure out who the "Impostors" are before they'),
    (6, 'Apex Legends', 'is an online multiplayer battle royale game featuring squads of three players using pre-made characters (called "Legends"), similar to those of hero shooters. Alternate modes have been introduced allowing for single and for two-player squads since the game\'s release.'),
    (7, 'Valorant', 'is a free-to-play multiplayer tactical first-person hero shooter ... Articles with short description · Short description is different from Wikidata · Articles using Infobox video game using locally defined parameters '),
    (8, 'Hearthstone', 'is a free-to-play online digital collectible card game developed and published by Blizzard Entertainment. ... The game is a turn-based card game between two opponents, using constructed decks of 30 cards along with a selected hero with a unique power.'),
    (9, 'Call of Duty: Modern Warfare', 'The game takes place in a realistic and modern setting. The campaign follows a CIA officer and British SAS forces as they team up with rebels from the fictional country of Urzikstan, combating together against Russian forces who have invaded the country.'),
    (10, 'Rocket League', 'is a fantastical sport-based video game, developed by Psyonix (it\'s “soccer with cars”). It features a competitive game mode based on teamwork and outmaneuvering opponents. Players work with their team to advance the ball down the field, and score goals in their opponents\' net.'),
    (11, 'ROBLOX', 'is an online game platform and game creation system that allows users to program games and play games created by other users. Founded by David Baszucki and Erik Cassel in 2004 and released in 2006, the platform hosts user-created games of multiple genres coded in the programming language Lua');
